import React, { useState } from "react";
import { manualPredict, csvPredict } from "../api";
import { useNavigate, Link } from "react-router-dom";

const mapEngagementLabel = (value) => {
  switch (value) {
    case 0:
      return "Low";
    case 1:
      return "Moderate";
    case 2:
      return "High";
    default:
      return "Unknown";
  }
};

const Dashboard = () => {
  const [studentId, setStudentId] = useState("");
  const [heartRate, setHeartRate] = useState("");
  const [skinConductance, setSkinConductance] = useState("");
  const [eeg, setEeg] = useState("");
  const [manualResult, setManualResult] = useState(null);
  const [manualFeedback, setManualFeedback] = useState("");

  const [csvFile, setCsvFile] = useState(null);
  const [csvResults, setCsvResults] = useState([]);
  const [csvError, setCsvError] = useState("");

  const navigate = useNavigate();

  const handleLogout = () => {
    localStorage.removeItem("token");
    navigate("/login");
  };

  const handleManualSubmit = async (e) => {
    e.preventDefault();
    setManualResult(null);
    setManualFeedback("");

    try {
      const data = {
        student_id: studentId,
        HeartRate: parseFloat(heartRate),
        SkinConductance: parseFloat(skinConductance),
        EEG: parseFloat(eeg),
      };
      const res = await manualPredict(data);
      setManualResult(res.data.EngagementLevel);
      setManualFeedback(res.data.Feedback || "");
    } catch (err) {
      alert(err.response?.data?.error || "Prediction failed");
    }
  };

  const handleCsvSubmit = async () => {
    setCsvResults([]);
    setCsvError("");

    if (!csvFile) {
      setCsvError("Please select a CSV file");
      return;
    }

    try {
      const res = await csvPredict(csvFile);
      setCsvResults(res.data);
    } catch (err) {
      setCsvError(err.response?.data?.error || "CSV Prediction failed");
    }
  };

  return (
    <div className="max-w-4xl mx-auto p-8 bg-gray-50 min-h-screen">
      {/* Navigation Bar */}
      <nav className="flex flex-wrap justify-between items-center mb-10 bg-white p-4 rounded-lg shadow-md">
        <div className="space-x-6">
          <Link
            to="/dashboard"
            className="text-blue-600 font-semibold hover:text-blue-800 transition"
          >
            Dashboard
          </Link>
          <Link
            to="/history"
            className="text-gray-700 hover:text-blue-600 transition"
          >
            History
          </Link>
          <Link
            to="/suggestion"
            className="text-gray-700 hover:text-blue-600 transition"
          >
            Suggestion
          </Link>
          <Link
            to="/profile"
            className="text-gray-700 hover:text-blue-600 transition"
          >
            Profile
          </Link>
        </div>
        <button
          onClick={handleLogout}
          className="bg-red-600 text-white px-4 py-2 rounded-md hover:bg-red-700 transition"
        >
          Logout
        </button>
      </nav>

      <h1 className="text-3xl font-bold mb-8 text-gray-800">Dashboard</h1>

      {/* Manual Input Section */}
      <section className="bg-white rounded-lg shadow-md p-6 mb-12">
        <h2 className="text-2xl font-semibold mb-6 border-b pb-3 text-gray-800">
          Manual Input Prediction
        </h2>
        <form onSubmit={handleManualSubmit} className="space-y-6">
          <div>
            <label
              htmlFor="studentId"
              className="block mb-2 font-medium text-gray-700"
            >
              Student ID
            </label>
            <input
              id="studentId"
              type="text"
              value={studentId}
              required
              onChange={(e) => setStudentId(e.target.value)}
              className="w-full px-4 py-2 border rounded-md border-gray-300 focus:outline-none focus:ring-2 focus:ring-blue-500 transition"
              placeholder="Enter student ID"
            />
          </div>
          <div>
            <label
              htmlFor="heartRate"
              className="block mb-2 font-medium text-gray-700"
            >
              Heart Rate
            </label>
            <input
              id="heartRate"
              type="number"
              step="0.01"
              value={heartRate}
              required
              onChange={(e) => setHeartRate(e.target.value)}
              className="w-full px-4 py-2 border rounded-md border-gray-300 focus:outline-none focus:ring-2 focus:ring-blue-500 transition"
              placeholder="e.g. 72.5"
            />
          </div>
          <div>
            <label
              htmlFor="skinConductance"
              className="block mb-2 font-medium text-gray-700"
            >
              Skin Conductance
            </label>
            <input
              id="skinConductance"
              type="number"
              step="0.01"
              value={skinConductance}
              required
              onChange={(e) => setSkinConductance(e.target.value)}
              className="w-full px-4 py-2 border rounded-md border-gray-300 focus:outline-none focus:ring-2 focus:ring-blue-500 transition"
              placeholder="e.g. 0.85"
            />
          </div>
          <div>
            <label
              htmlFor="eeg"
              className="block mb-2 font-medium text-gray-700"
            >
              EEG
            </label>
            <input
              id="eeg"
              type="number"
              step="0.01"
              value={eeg}
              required
              onChange={(e) => setEeg(e.target.value)}
              className="w-full px-4 py-2 border rounded-md border-gray-300 focus:outline-none focus:ring-2 focus:ring-blue-500 transition"
              placeholder="e.g. 1.2"
            />
          </div>
          <button
            type="submit"
            className="bg-blue-600 hover:bg-blue-700 text-white font-semibold px-6 py-3 rounded-md transition"
          >
            Predict Now
          </button>
        </form>

        {manualResult !== null && (
          <div className="mt-8 bg-blue-50 border border-blue-300 p-4 rounded-md">
            <p className="text-lg font-semibold text-blue-800">
              Predicted Engagement Level:{" "}
              <span className="font-normal text-gray-900">
                {mapEngagementLabel(manualResult)}
              </span>
            </p>
            <p className="mt-2 text-gray-700">
              <strong>Feedback:</strong> {manualFeedback}
            </p>
          </div>
        )}
      </section>

      {/* CSV Upload Section */}
      <section className="bg-white rounded-lg shadow-md p-6">
        <h2 className="text-2xl font-semibold mb-4 border-b pb-3 text-gray-800">
          Upload CSV File
        </h2>
        <p className="mb-4 text-sm text-gray-600">
          CSV must include columns: <code>student_id</code>,{" "}
          <code>HeartRate</code>, <code>SkinConductance</code>, <code>EEG</code>
        </p>
        <div className="flex flex-wrap items-center space-x-4">
          <input
            type="file"
            accept=".csv"
            onChange={(e) => setCsvFile(e.target.files[0])}
            className="border border-gray-300 rounded-md p-2 cursor-pointer"
          />
          <button
            onClick={handleCsvSubmit}
            className="bg-blue-600 hover:bg-blue-700 text-white font-semibold px-6 py-2 rounded-md transition"
          >
            Predict CSV
          </button>
        </div>
        {csvError && (
          <p className="mt-3 text-red-600 font-semibold">{csvError}</p>
        )}

        {csvResults.length > 0 && (
          <div className="mt-8 overflow-auto">
            <table className="min-w-full border-collapse border border-gray-300 rounded-md">
              <thead className="bg-gray-100">
                <tr>
                  {[
                    "Student ID",
                    "HeartRate",
                    "SkinConductance",
                    "EEG",
                    "Predicted Engagement Level",
                    "Feedback",
                  ].map((header) => (
                    <th
                      key={header}
                      className="border border-gray-300 px-4 py-2 text-left text-gray-700 font-semibold"
                    >
                      {header}
                    </th>
                  ))}
                </tr>
              </thead>
              <tbody>
                {csvResults.map((row, i) => (
                  <tr
                    key={i}
                    className={i % 2 === 0 ? "bg-white" : "bg-gray-50"}
                  >
                    <td className="border border-gray-300 px-4 py-2">
                      {row.student_id || row.studentId || "N/A"}
                    </td>
                    <td className="border border-gray-300 px-4 py-2">
                      {row.HeartRate}
                    </td>
                    <td className="border border-gray-300 px-4 py-2">
                      {row.SkinConductance}
                    </td>
                    <td className="border border-gray-300 px-4 py-2">{row.EEG}</td>
                    <td className="border border-gray-300 px-4 py-2">
                      {mapEngagementLabel(row.PredictedEngagementLevel)}
                    </td>
                    <td className="border border-gray-300 px-4 py-2">
                      {row.Feedback || ""}
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        )}
      </section>
    </div>
  );
};

export default Dashboard;
